import { BrowserRouter, Routes, Route } from "react-router-dom";
import logo from './logo.svg';
import './App.css';
import './Home.js';

function App() {
  return (
    <div className="App">
		    <BrowserRouter>
		      <Routes>
		        <Route index element={<Home />} />
		      </Routes>
		    </BrowserRouter>
    </div>
  );
}

export default App;
